css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

@-moz-document url-prefix("chrome://stylish/content/stylish.xul"), url-prefix("chrome://stylish/content/manage.xul") {

#styles-children {
    background-color: #000000 !important;
    background-image: url("data:image/jpg;base64,") !important;
    background-attachment: scroll !important;
    background-position: right center !important;
    background-repeat: no-repeat !important;
    }

#styles-children::-moz-tree-cell-text {
    color: #FFFFFF !important;
    }

#styles-children::-moz-tree-cell(current) {
    background-color: #000000 !important;
    }

#styles-children::-moz-tree-cell-text(current) {
    color: #FFFFFF !important;
    background-color: #000000 !important;
    font-weight: bold !important;
    }


#styles-children::-moz-tree-checkbox { list-style-image: url("data:image/x-png;base64,") !important;
   }


#styles-children::-moz-tree-checkbox(checked) {
      list-style-image: url("data:image/x-png;base64,") !important;
   }

}
